actionConfiguration.body:
file => {
  let temp = file.data + "";
  temp = temp.split(";base64,");
  let mime = temp[0].split('/');
  mime = mime[1];
  let binary = temp[1];
  return {
    mime: mime,
    binary: binary,
    name: file.name
  };
}

